import './App.css';
import { BrowserRouter as Router,Route} from 'react-router-dom'
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

function App() {
  return (


    <div className="App">
      <Header/>
      <Route path="/" exact element={ <NotesListPage/>}/>
    </div>


  );
}

export default App;
